CREATE OR REPLACE FUNCTION update_song_search_vector()
RETURNS TRIGGER AS $$
BEGIN
    NEW."SearchVector" := 
        setweight(to_tsvector('simple', NEW."Emotion"::text), 'A') || 
        setweight(to_tsvector('simple', NEW."Title"), 'B') || 
        setweight(to_tsvector('simple', NEW."Artist"), 'C');
RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER trigger_update_search_vector
    BEFORE INSERT OR UPDATE ON "Songs"
                         FOR EACH ROW EXECUTE FUNCTION update_song_search_vector();

CREATE OR REPLACE FUNCTION create_favourite_playlist_for_new_user()
RETURNS TRIGGER AS $$
BEGIN
    "Name",
    "Description",
    "UserId",
    "CreatedAt",
    "UpdatedAt"
) VALUES (
             'Favourite',
             '',
             NEW."Id",
             NOW(),
             NULL
         );

RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER tr_create_favourite_playlist
    AFTER INSERT ON "ApplicationUsers"
    FOR EACH ROW EXECUTE FUNCTION create_favourite_playlist_for_new_user();

CREATE OR REPLACE FUNCTION prevent_favourite_playlist_deletion()
RETURNS TRIGGER AS $$
BEGIN
    IF OLD."Name" = 'Favourite' THEN
        RAISE EXCEPTION 'Нельзя удалять плейлист "Favourite"';
END IF;
RETURN OLD;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER tr_prevent_favourite_deletion
    BEFORE DELETE ON "Playlists"
    FOR EACH ROW EXECUTE FUNCTION prevent_favourite_playlist_deletion();



